C INTERFACES
C.1 Network Interface
TensorNEAT offers users the flexibility to define a custom network that will be optimized by the NEAT algorithms by providing a network
interface (as presented in Listing 1 and Listing 2). Users are required to define the specific behaviors associated with their network, including
initialization, mutation, distance computation, and inference.
By implementing these interfaces, users can fit their specific requirements and leverage TensorNEAT’s power for a wide range of neural
network architectures.
class BaseGene :
fixed_attrs = []
custom_attrs = []
def __init__ ( self ):
pass
def new_custom_attrs ( self ):
raise NotImplementedError
def mutate (self , randkey , gene ):
raise NotImplementedError
def distance (self , gene1 , gene2 ):
raise NotImplementedError
def forward (self , attrs , inputs ):
raise NotImplementedError
